INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, 2, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1.4, 0, "春咲 ひより", 1, 1, "お！\nあそこに困ってそうな人発見！", 1001);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, 2, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1.4, 0, "草野 優衣", 1, 1, "大切な人を\n守れるようになりたい…って", 1002);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("少しは磨かれると思いますよ。", 1, 0, 2, 0, "フェンシングを始めてみては？", 0, 0, 1.4, 0, "士条 怜", 1, 1, "キミに必要な集中力と感性が", 1003);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, 2, 0, "ねぇ、にいちゃん！", 0, 0, 1.5, 0, "穂高 みそぎ", 1, 1, "今日はなにして遊ぶ？", 1004);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("私といっしょに…\nいかない？", 1, 0, 2, 0, "風宮あかりです", 0, 0, 1.4, 0, "風宮 あかり", 1, 1, "ねぇ…", 1006);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("食べ物の恨みは怖いのー", 1, 0, 2, 0, "出雲宮子なのー", 0, 0, 1.5, 0, "出雲 宮子", 1, 1, "プリンたべたいのー", 1007);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("いいよ。\n見られることは運命さ…", 1, 0, 2, 0, "ボクは虹村雪。", 0, 0, 1.4, 0, "虹村 雪", 1, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("人呼んで「疾風の冥姫」!!", 1, 0, 2, 0, "フッ…聞いて後悔するがいい！", 0, 0, 1.4, 0, "柊杏奈", 1, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ほんまおおきにやわ～♪", 1, 0, 2, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1.5, 0, "姫宮 真歩", 1, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ここで会ったが\n100年目～！", 1, 0, 2, 0, "衣之咲璃乃です！", 0, 0, 1.4, 0, "衣之咲 璃乃", 1, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 1011);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", 1, 0, 2, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1.4, 0, "柏崎 初音", 1, 1, "ち、超能力って…\n何のことかな～？", 1012);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, 2, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1.4, 0, "美波 鈴奈", 1, 1, "一応カリスマ読モJKやってまっす！", 1016);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("でも、沖縄もとってもいいとこさー", 1, 0, 2, 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 1.4, 0, "喜屋武 香織", 1, 1, "東京は遊園地みたいなところさー", 1017);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("イオちゃんって呼んでね。", 1, 0, 2, 0, "支倉伊緒です。", 0, 0, 1.4, 0, "支倉 伊緒", 1, 1, "先生って呼ばれるのは\nくすぐったいから", 1018);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ミミをおいてかないでぇ～", 1, 0, 2, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1.5, 0, "茜 ミミ", 1, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 1020);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ふぇぇぇぇぇん……", 1, 0, 2, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1.5, 0, "栗林 くるみ", 1, 1, "あの……\nふぇ……", 1021);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("なんてありがとうございます！", 1, 0, 2, 0, "風宮よりです。\nあああああ！", 0, 0, 1.4, 0, "風宮 より", 1, 1, "こんな私に貴重な時間を\n割いていただき、", 1022);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("私こっち行きたいー\nね、早く早くー", 1, 0, 2, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1.5, 0, "北条 綾音", 1, 1, "おにいちゃんどこいくの？\nえ？", 1023);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("これて何か違う…\nあああすみません！", 1, 0, 2, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1.4, 0, "天野 すずめ", 1, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 1025);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("離しませんわ………\n絶対に…!!", 1, 0, 2, 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 1.4, 0, "倉石 恵理子", 1, 1, "あなたは…運命の……\n伴侶……", 1027);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("…そうでしょ？？", 1, 0, 2, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1.4, 0, "佐々木 咲恋", 1, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("あはは、\n私もまだまだだなぁ～", 1, 0, 2, 0, "桜井望だよ！\nよろしくねっ", 0, 0, 1.4, 0, "桜井 望", 1, 1, "ぇっと…\nキミ、私のこと知らないの?!", 1029);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, 2, 0, "デケデケデンっ！", 0, 0, 1.4, 0, "ニノン・ジュベール", 1, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 1030);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("おかしいですね……", 1, 0, 2, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1.4, 0, "上喜 しのぶ", 1, 1, "でもって私の隣にいるのが……\nえ、見えない？", 1031);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("そう、\nオラのボケに突っ込める相方が…！", 1, 0, 2, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1.5, 0, "野戸まひる", 1, 1, "けんども\nそれには足りないモンが…", 1033);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ちょ\nちょっと一杯飲んできます…！", 1, 0, 2, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1.4, 0, "綾瀬 ゆかり", 1, 1, "ちょっと緊張しちゃって…", 1034);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("これ以上お話しすることは…\nないです！", 1, 0, 2, 0, "氷川鏡華…です", 0, 0, 1.5, 0, "氷川 鏡華", 1, 1, "知らない人とは話しちゃいけないので", 1036);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, 2, 0, "柏崎…栞です。", 0, 0, 1.4, 0, "柏崎 栞", 1, 1, "……あ、アラーム。", 1038);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("野に咲く花が、\n唯一の話相手です。", 1, 0, 2, 0, "ふ、双葉碧です。", 0, 0, 1.4, 0, "双葉 碧", 1, 1, "私、一人も友達がいなくて……", 1040);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("そう思っています。", 1, 0, 2, 0, "三角千歌です。", 0, 0, 1.4, 0, "三角 千歌", 1, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("う、疑ってすまなかったな…", 1, 0, 2, 0, "安芸真琴だ。", 0, 0, 1.4, 0, "安芸 真琴", 1, 1, "あぁ？\nお前のそいつの仲間か？", 1043);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, 2, 0, "わらわこそは夜を総べる者！", 0, 0, 1.4, 0, "イリヤ・オーンスタイン", 1, 1, "生けとし生ける全ての者よ！", 1044);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ｌク、クウカに何かご用ですか!?", 1, 0, 2, 0, "そこで騎士は妖精を乱暴に……", 0, 0, 1.4, 0, "遠見 空花", 1, 1, "ぐふふふふ……はっ！", 1045);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, 2, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1.4, 0, "宮坂たまき", 1, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, 2, 0, "大神美冬よ！", 0, 0, 1.4, 0, "大神 美冬", 1, 1, "それでは早速クエストに…", 1048);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, 2, 0, "星野静流だよ！", 0, 0, 1.4, 0, "星野静流", 1, 1, "クエストもバトルも\n掃除も洗濯も", 1049);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0, 2, 0, "アタシは玉泉美咲。", 0, 0, 1.5, 0, "玉泉美咲", 1, 1, "見ての通りの\nセクシー美少女で", 1050);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("？？？？", 1, 0, 2, 0, "？？？", 0, 0, 1.4, 0, "リマ", 1, 1, "？？？？", 1052);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("そ、そこまでいうなら\nもらってやる", 1, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1.5, 0, "モニカ・ヴァイスヴィント", 1, 1, "菓子でつろうなどと\n稚拙な策を……", 1053);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("そ、そこまでいうなら\nもらってやる", 1, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1.5, 0, "ペコリーヌ", 1, 1, "菓子でつろうなどと\n稚拙な策を……", 1058);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("そ、そこまでいうなら\nもらってやる", 1, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1.5, 0, "コッコロ", 1, 1, "菓子でつろうなどと\n稚拙な策を……", 1059);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("そ、そこまでいうなら\nもらってやる", 1, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 1.5, 0, "キャル", 1, 1, "菓子でつろうなどと\n稚拙な策を……", 1060);
